import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "./notes"
import CreateArea from"./CreateArea";
var React=require("react");

function App(){
    return (<div>
        <Header></Header>
        <CreateArea />
        {notes.map(x=> (
        <Note
          key={x.key}
          title={x.title}
          content={x.content}
        />
      ))}
        <Footer></Footer> 
    </div>);
}
export default App;
